import React from 'react';
import {
    BrowserRouter as Router,
    Route,
    Link
  } from 'react-router-dom';
import BodyOld from './BodyOld';

const form = () => (<div><p>商品注文ページ</p></div>)
const bodyOld = () => <BodyOld />

const Order = () => {
    return(
        <Router>
            <div>
                <div>
                    <p><Link to='/bodyOld'>注文へ進む</Link></p>
                </div>
                <div>
                    <Route path='/bodyOld' exact component={bodyOld}/>   
                </div>
            </div>
        </Router>
    )
}

export default Order;
